import './style.scss';

import HeaderText from './HeaderText';

import scroll from './../../images/ic-scroll.svg';

function Header() {
  return (
    <div className="header-container">
      <HeaderText />

      <img style={{marginTop}} src={scroll} alt="scroll" />
    </div>
  );
}

export default Header;
